import React from 'react';


export default function MenuItem() {
    function renderizarLink() {
        return (
            <a className={`
                    flex flex-col justify-center items-center
                    h-20 w-20
                    dark:text-gray-200
                   
                `}>
                
                <span className={`text-xs font-light`}>
                    
                </span>
            </a>
        )
    }
    return (
        <li className={`
            hover:bg-gray-100 dark:hover:bg-gray-800
            cursor-pointer
        `}>
            TESTE
        </li>
    )
}
